import React, { Component } from 'react';
import { Layout, Menu } from 'antd';
const { Header, Footer } = Layout
// import Header from '../../components/header';
// import Banner from '../../components/banner';
// import NewSong from '../../components/newsong';

class Home extends Component{
    constructor(props) {
        super(props);
    }
    render(){
        return(
            <Layout className="layout">
                <Header>
                    <div className="logo" />
                    <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
                        <Menu.Item key="1">推荐</Menu.Item>
                        <Menu.Item key="2">排行榜</Menu.Item>
                        <Menu.Item key="3">歌单</Menu.Item>
                        <Menu.Item key="4">主播电台</Menu.Item>
                        <Menu.Item key="5">排行榜</Menu.Item>
                        <Menu.Item key="6">歌手</Menu.Item>
                        <Menu.Item key="7">新碟上架</Menu.Item>
                        <Menu.Item key="8">登录</Menu.Item>
                    </Menu>
                </Header>
                <Footer></Footer>
            </Layout>
        )
    }
}

export default Home;
